import React from 'react'; 
import './GamesList.css';


const GamesList = ({games}) => {
	return (
		<div class='games-container'>
			{ 
				games.map(i => {
					<div className="game">{i}</div>
				})
			}
		</div>
		);
}
export default GamesList;
